// import express from "express";
const express = require("express");
const router = require("./routers/men.js");
require("../src/db/conn.js");

const app = express();
const port = process.env.PORT || 3000;

app.use(express.json());

app.use(router);

console.log(port);

app.listen(port, () => {
  console.log("go live");
});

