import express from "express";
const router = express.Router();

const {
  createMen,
  getAllMen,
  getSingleMen,
  editMen,
  deleteMen,
} = require("../controller.js/UserController");

router.get("/", getAllMen);
router.post("/create", createMen);
router.patch("/edit/:id", editMen);
router.delete("/delete/:id", deleteMen);

module.exports = router;

