const MensRanking = require("../models/produts");

module.exports.createMen = async (req, res) => {
  try {
    const addMen = new MensRanking(req.body);
    console.log("hello", req.body);
    const mensData = await addMen.save();
    res.send(mensData);
  } catch (e) {
    res.status(400).send(e);
  }
};

module.exports.getAllMen = async (req, res) => {
  try {
    const getMen = await MensRanking.find({});
    res.send(getMen);
  } catch (e) {
    res.status(409).send(e);
  }
};
// get for individual
// module.exports.getSingleMen = async (req, res) => {
//   try {
//     const _id = req.params.id;
//     const getSingleMen = await MensRanking.findById({ _id });
//     res.send(getSingleMen);
//   } catch (e) {
//     res.status(400).send(e);
//   }
// };

module.exports.editMen = async (req, res) => {
  try {
    const _id = req.params.id;
    const getSingleMen = await MensRanking.findByIdAndUpdate(_id, req.body);
    res.send(getSingleMen);
  } catch (e) {
    res.status(400).send(e);
  }
};
// delete method;

module.exports.deleteMen = async (req, res) => {
  try {
    const _id = req.params.id;
    const getSingleMen = await MensRanking.findByIdAndDelete({ _id });
    res.send(getSingleMen);
  } catch (e) {
    res.status(400).send(e);
  }
};

