import express from "express";
const router = express.Router();

const {
  createProduct,
  getAllProduct,
  editProduct,
  deleteProduct,
  getSingleProduct,
} = require("../controller.js/ProductController");

router.get("/", getAllProduct);
router.post("/create", createProduct);
